const Footer = () => {
    return(
        <div>
            <div className= "footer-box">
                <div className = "quick-links">
                Quick Links
                </div>
            </div>
    <style jsx>{`
    
    .footer-box {
        position: absolute;
        width: 1344px;
        height: 434px;
        left: 0px;
        top: 5415px;
        background: #000000;
    }

    .quick-links {
        position: absolute;
        width: 125px;
        height: 28px;
        left: 54px;
        top: 5488px;
        font-family: Roboto;
        font-style: normal;
        font-weight: 500;
        font-size: 24px;
        line-height: 28px;
        color: red;
    }
    `}</style>
        </div>
    )
}

export default Footer
